import axios from "axios";

class tempClass {
  constructor(props) {
    // super(props);
    this.state = {
      id: "",
      title: "",
      contents: "",
      email: "",
      read_cnt: "",
    };
  }

  componentDidMount() {
    axios.get("http://localhost:8080/feedback").then((response) => {
      console.log(response.data);
    });
  }

  render() {
    this.componentDidMount();
    return <div className="tempClass">temp</div>;
  }
}

export default tempClass;
